import BMI from "./images/BMI";
import ASCAP from "./images/ASCAP";
import SESAC from "./images/SESAC";
import GMR from "./images/GMR";
import HFA from "./images/HFA";

const PROs = () => {
  return (
    <div>
      <img src={BMI} alt="" />
      <img src={ASCAP} alt="" />
      <img src={SESAC} alt="" />
      <img src={GMR} alt="" />
      <img src={HFA} alt="" />
    </div>
  );
};

export default PROs;
